		function ShowInfo (target) {
			var buttons = menuButtons.slice(0);
			var targetIndex = buttons.indexOf(target);
			buttons.splice(targetIndex,1);
			
			for(var i = 0; i<buttons.length; i++){
				createjs.Tween.removeTweens(buttons[i]);
				createjs.Tween.get(buttons[i]).to({alpha:0.25}, 800, createjs.Ease.cubicOut);
				buttons[i].mouseEnabled = false;
			}
			createjs.Tween.removeTweens(infoPanels[targetIndex]);
			createjs.Tween.removeTweens(mainTimeline.StartButton);
			createjs.Tween.get(infoPanels[targetIndex]).to({alpha:1}, 500, createjs.Ease.cubicOut);
			createjs.Tween.get(mainTimeline.StartButton).wait(250).to({alpha:1}, 500, createjs.Ease.cubicOut);
			currentSelection = targetIndex + 1;
		}
		
		function HideInfo (target) {
			var buttons = menuButtons.slice(0);
			var targetIndex = buttons.indexOf(target);
			buttons.splice(targetIndex,1);
			
			for(var i = 0; i<buttons.length; i++){
				createjs.Tween.removeTweens(buttons[i]);
				createjs.Tween.get(buttons[i]).to({alpha:1}, 800, createjs.Ease.cubicOut);
				buttons[i].mouseEnabled = true;
			}
			createjs.Tween.removeTweens(infoPanels[targetIndex]);
			createjs.Tween.removeTweens(mainTimeline.StartButton);
			createjs.Tween.get(infoPanels[targetIndex]).to({alpha:0}, 500, createjs.Ease.cubicOut);
			createjs.Tween.get(mainTimeline.StartButton).to({alpha:0}, 500, createjs.Ease.cubicOut);
			currentSelection = 0;
			
			hideTestButtons();
		}
		
		function StartRandomScenario () {
			var randomNumber = Math.floor(Math.random() * (8 - 0 + 1)) + 0;
			StartScenario(randomNumber);
		}
		
		function StartScenario (scenario) {
			HideStartMenu();
			hideTestButtons();
			mainTimeline.BackButton.visible = true;
			currentScenario = allScenarios[currentSelection-1][scenario];
			currentScenario.visible = true;
			currentScenario.gotoAndPlay(1);
			
			if(!isMusicPlaying){
				isMusicPlaying = true;
				
				var musicInstance = createjs.Sound.play("sounds/Music.mp3", {loop:-1, volume:0.8});
			}
			/*switch(currentSelection){
				case 1:
					ambienceInstance = createjs.Sound.play("sounds/SSSprawl.mp3", {loop:-1});
					break;
				case 2:
					ambienceInstance = createjs.Sound.play("sounds/SSAgricultural.mp3", {loop:-1});
					break;
				case 3:
					ambienceInstance = createjs.Sound.play("sounds/SSLowImpact.mp3", {loop:-1});
					break;
				case 4:
					ambienceInstance = createjs.Sound.play("sounds/SSIndustrial.mp3", {loop:-1});
					break;
			}*/
		}
		
		function ShowStartMenu () {
			for(var i = 0; i<menuButtons.length; i++){
				menuButtons[i].visible = true;
				menuButtons[i].alpha = 1;
				menuButtons[i].mouseEnabled = true;
			}
			for(var i = 0; i<infoPanels.length; i++){
				infoPanels[i].visible = true;
				infoPanels[i].alpha = 0;
			}
			mainTimeline.StartButton.alpha = 0;
			mainTimeline.StartButton.visible = true;
			currentScenario.visible = false;
			mainTimeline.BackButton.visible = false;
			window.StopAllButMusic();
		}
		
		function HideStartMenu () {
			for(var i = 0; i<menuButtons.length; i++){
				menuButtons[i].visible = false;
				menuButtons[i].alpha = 1;
			}
			for(var i = 0; i<infoPanels.length; i++){
				infoPanels[i].visible = false;
				infoPanels[i].alpha = 0;
			}
			mainTimeline.StartButton.visible = false;
		}
		
		
