		window.StopSoundEffects = function () {
			var toStop = [];
			for(var i = 0; i<createjs.Sound._instances.length; i++){
				if(createjs.Sound._instances[i].src != "sounds/SSAgricultural.mp3" &&
					createjs.Sound._instances[i].src != "sounds/SSIndustrial.mp3" &&
					createjs.Sound._instances[i].src != "sounds/SSLowImpact.mp3" &&
					createjs.Sound._instances[i].src != "sounds/SSSprawl.mp3" &&
					createjs.Sound._instances[i].src != "sounds/Music.mp3"
				){
					toStop.push(createjs.Sound._instances[i]);
				}
			}
			for(var i = 0; i<toStop.length; i++){
				toStop[i].stop();
			}
		}
		
		window.StopAmbience = function () {
			var toStop = [];
			for(var i = 0; i<createjs.Sound._instances.length; i++){
				if(createjs.Sound._instances[i].src != "sounds/SSAgricultural.mp3" ||
					createjs.Sound._instances[i].src != "sounds/SSIndustrial.mp3" ||
					createjs.Sound._instances[i].src != "sounds/SSLowImpact.mp3" ||
					createjs.Sound._instances[i].src != "sounds/SSSprawl.mp3"
				){
					toStop.push(createjs.Sound._instances[i]);
				}
			}
			for(var i = 0; i<toStop.length; i++){
				toStop[i].stop();
			}
		}
		
		window.StopAllButMusic = function () {
			var toStop = [];
			for(var i = 0; i<createjs.Sound._instances.length; i++){
				if(createjs.Sound._instances[i].src != "sounds/Music.mp3"){
					toStop.push(createjs.Sound._instances[i]);
				}
			}
			for(var i = 0; i<toStop.length; i++){
				toStop[i].stop();
			}
		}
		
		
		
